var ArrayList=function(){this.list=[];this.add=function(A){this.list.push(A)};this.get=function(A){return this.list[A]};this.size=function(){return this.list.length};this.removeAll=function(){this.list=[]};this.remove=function(A){var C=[];for(var B in this.list){if(B!=A){C.push(this.list[B])}}this.list=C}};